    g_TurnAng = 36;
    // 移動
    g_MoveDir.Set(g_AtkTarData.vWay);
    g_Speed = 0.5;
    g_MoveFric = 0.9;
  }

//  g_CalcBodyBaseRX.Mode_Homing_Add(0, 45,45,5,g_AtkTarData.lpTar);
  g_BodyBaseData.CalcStart(45,45,5);

  return 0;
}

